create table airline
(
    id                  bigint auto_increment
        primary key,
    iata_code           varchar(16)  null,
    icao_code           varchar(16)  null,
    accounting_code     varchar(16)  null,
    airline_prefix_code varchar(16)  null,
    eng_name            varchar(128) null,
    chn_name            varchar(128) null,
    call_sign           varchar(64)  null,
    country_iso2_code   varchar(16)  null,
    city_iso3_code      varchar(16)  null,
    description         longtext     null,
    city_id             bigint       null,
    country_id          bigint       null,
    is_delete           tinyint(1)   not null,
    create_datetime     datetime(6)  not null,
    create_by           varchar(32)  not null,
    update_datetime     datetime(6)  not null,
    update_by           varchar(32)  not null,
    constraint airline_city_id_78fe9dde_fk_city_id
        foreign key (city_id) references city (id),
    constraint airline_country_id_008d2827_fk_country_id
        foreign key (country_id) references country (id)
);

create index airline_create_datetime_d0f1318f
    on airline (create_datetime);

create index airline_update_datetime_f8b5daa0
    on airline (update_datetime);

